import {
    Avatar,
    Card,
    CardContent,
    Grid,
    Typography
  } from '@material-ui/core';
  
  const LangCard = ({languages, totalSolved}) => (
    <Card >
      <CardContent>
        <Grid
          container
          spacing={1}
        >
          <Grid item>
            <Typography
              color="textSecondary"
              gutterBottom
              variant="h6"
            >
              TOP LANGUAGE
            </Typography>
            <Typography
              color="textPrimary"
              variant="h3"
            >
                {
                console.log(totalSolved[0].reduce((a, b)=>(a < b))),
                console.log(
                    totalSolved[0].indexOf(totalSolved[0].map((a, b)=>(a < b)))
                )}
              {languages[0][1]}
            </Typography>
          </Grid>
        </Grid>
      </CardContent>
    </Card>
  );
  
  export default LangCard;
